from bs4 import BeautifulSoup

def extract_main_text(url):
    # 使用BeautifulSoup解析网页

    url = "https://ggzyjy.sc.gov.cn/jyxx/002001/002001005/20230609/fe8db4c6-a781-4b03-9ba3-e3e837205ef3.html"

    payload = {}
    headers = {'Content-Type': 'application/json;charset=UTF-8'}

    response = requests.request("GET", url, headers=headers, data=payload)
    soup = BeautifulSoup(response.text, 'html.parser')

    # 过滤掉HTML标签
    text = soup.get_text()
    print(text)
    # 计算每个字符出现的频率
    density = {}
    for char in text:
        if char in density:
            density[char] += 1
        else:
            density[char] = 1

    # 找到文本密度最高的几行
    max_density = max(density.values())
    max_density_lines = [line for line, line_density in enumerate(density.values()) if line_density == max_density]

    # 从起始行号到结束行号之间的文本就是正文
    start_line = min(max_density_lines)
    end_line = max(max_density_lines)
    main_text = ' '.join(text.splitlines()[start_line:end_line + 1])

    return main_text


extract_main_text('https://www.jl.gov.cn/ggzy/zfcg/cggg/202302/t20230221_8671347.html')